import React from "react";
import "./Nav.css";

const Nav = () => {
  return (
    <div className="nav">
      <img
        src="https://upload.wikimedia.org/wikipedia/commons/7/7a/Logonetflix.png"
        alt="Netflix Logo"
        className="nav_logo"
      ></img>
      <img
        src="https://upload.wikimedia.org/wikipedia/commons/0/0b/Netflix-avatar.png"
        alt="Avatar Logo"
        className="nav_avatar"
      />
    </div>
  );
};

export default Nav;
